import { Overlay, ModalSt } from './Modal.styled';

export const Modal = ({ closeModal, largeImage }) => {
  return (
    <Overlay onClick={closeModal}>
      <ModalSt>
        <img src={largeImage.src} alt={largeImage.alt} />
      </ModalSt>
    </Overlay>
  );
};
